    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Lake Ophelia NWR for the next 15 years. This
    plan outlines the Refuge vision and purpose and describes how Lake Ophelia NWR will
    contribute to the overall mission of the Refuge System. The plan provides an introduction
    to the Refuge, an overview of the CCP process, and information on the management
    direction and plan implementation. Key planning issues include: threatened and endangered
    species, habitats, visitor services, general administration, and land protection.",nt"license_title":
